}

function ImageInfoBlock(props) {

    if(props.isDark) {
        imageInfoBlock = {...imageInfoBlock, background: 'rgba(44,42,41)', color: 'white'}
    }



    return (
        <div style={ imageInfoBlock } className="imageInfoBlock">
            <div style={ imgBl }> 
                <img src={ props.image } alt={props.headding} style={ img } />
            </div>
            <div style={ textBl }>
                {props.text}
            </div>
        </div>
    );
}

export default ImageInfoBlock;
